  class ResMgr {
    constructor() {
      this.files = [];
    }
    add(url) {
      if (this.get(url)) return;
      this.files.push({
        name: url,
        blob: null,
        burl: null,
        load: false
      });
      // async data requesting
      fetch(`${url}`)
        .then(req => req.arrayBuffer())
        .then(data => {
          if (url.includes('voice'))
            data = pako.inflate(data)
          let file = this.get(url);
          if (!file) return;
          file.load = true;
          file.blob = data;
          file.burl = window.URL.createObjectURL(new Blob([new Uint8Array(data)]));
          this.onStepLoaded && this.onStepLoaded()
          if (this.status() === 1) {
            this.onload ? this.onload() : null;
          }
        });
    }
    get(url) {
      return this.files.find(file => file.name === url);
    }
    getBlobUrl(url) {
      let file = this.get(url);
      if (!file) return null;
      return this.get(url).burl;
    }
    status() {
      return this.files.filter(file => file.load).length / this.files.length;
    }
  }

  class Story {
    constructor(id, lines, resmgr) {
      this.messages = []
      this.pointer = 0
      this.resmgr = resmgr
      this.hidden = false
      this.el = document.getElementById(id + '-container')
      this.labelEl = document.getElementById(id + '-label')
      this.bgmEl = document.getElementById(id + '-bgm')
      this.voiceEl = document.getElementById(id + '-voice')
      this.sceneEl = document.getElementById(id + '-scene')
      this.dialogEl = document.getElementById(id + '-dialog')
      for (let i = 0; i < lines.length; ++i) {
        let words = lines[i].split(',')
        // remove blank messages
        if (words.length < 2) {
          continue
        }
        // name is name in mess but imagePath in image
        this.messages.push({
          type: words[0],
          name: words[1],
          text: words[2],
          voice: words[3]
        })
      }
      this.resmgr.onStepLoaded = () => document.getElementById('hs-loading').innerHTML = `Loading: ${ this.resmgr.status() * 100}%...`
      this.loadResource()
    }
    loadResource() {
      for (let i = 0; i < this.messages.length; ++i) {
        let mess = this.messages[i]
        switch (mess.type) {
          case 'mess':
            if (mess.voice) {
              this.resmgr.add(`http://dugrqaqinbtcq.cloudfront.net/product/voice/c`
              + `/${mess.voice.split('/')[0]}/${ MD5(mess.voice.split('/')[1]) }.bin?2333`)
            }
            break;
          case 'image':
            if (mess.name) {
              this.resmgr.add(`http://dugrqaqinbtcq.cloudfront.net/product/ynnFQcGDLfaUcGhp/assets/ultra/images/hscene_r18`
              + `/${ MD5(mess.name.split('/')[1]) }.bin?2333`)
            }
            break;
          default:
            break;
        }
      }
      this.resmgr.onload = () => {
        document.getElementById('hs-loading').style.display = 'none'
        window.addEventListener('wheel', evt => {
          if (evt.target.id === '' || !evt.target.id.startsWith('hs-')) {
            return
          }
          this.pointer += evt.deltaY * 0.01 - 1 ;
          this.next()
        })
        window.addEventListener('click', evt => {
          if (evt.target.id === '' || !evt.target.id.startsWith('hs-')) {
            return
          }
          if (this.hidden) {
            this.dialogEl.style.opacity = 1
            this.labelEl.style.opacity = 1
            this.hidden = false
            return
          }
          this.next()
        })
        window.addEventListener('contextmenu', evt => {
          if (evt.target.id === '' || !evt.target.id.startsWith('hs-')) {
            return
          }
          if (this.hidden) {
            this.dialogEl.style.opacity = 1
            this.labelEl.style.opacity = 1
          } else {
            this.dialogEl.style.opacity = 0
            this.labelEl.style.opacity = 0
          }
          this.hidden = !this.hidden
          evt.preventDefault()
        })
      }
    }
    next() {
      this.bgmEl.play()
      if (this.pointer < 0) this.pointer = 0
      let current = this.messages[this.pointer]
      switch (current.type) {
        case 'mess':
          let name = current.name
          if (name !== '') {
            this.labelEl.style.display = 'block'
            this.labelEl.children[0].innerHTML = current.name
          } else {
            this.labelEl.style.display = 'none'
          }

          let text = current.text
          if (text !== '') {
            this.dialogEl.style.display = 'flex'
            this.dialogEl.children[0].innerHTML = current.text.replace(/\\n/g, '<br>')
          } else {
            this.dialogEl.style.display = 'none'
          }

          if (current.voice !== '') {
            this.voiceEl.src = this.resmgr.getBlobUrl(`http://dugrqaqinbtcq.cloudfront.net/product/voice/c`
            + `/${current.voice.split('/')[0]}/${ MD5(current.voice.split('/')[1]) }.bin?2333`)
            this.voiceEl.play()
          }
          break;
        case 'effect':
          break;
        case 'image':
          this.sceneEl.style.opacity = 0
          setTimeout(() => {
            this.sceneEl.src = `${this.resmgr.getBlobUrl(
              `http://dugrqaqinbtcq.cloudfront.net/product/ynnFQcGDLfaUcGhp/assets/ultra/images/hscene_r18`
              + `/${ MD5(current.name.split('/')[1]) }.bin?2333`)}`
            this.sceneEl.style.opacity = 1
          }, 400)
          break;
        default:
          break;
      }
      if (this.pointer < this.messages.length - 1)
        this.pointer++
    }
  }

