  function lazyload() {
    let images = document.getElementsByTagName('img')
    let n = 0
    return function () {
      let seeHeight = document.documentElement.clientHeight;
      let scrollTop = document.documentElement.scrollTop || document.body.scrollTop;
      for (let i = n; i < images.length; i++) {
        if (images[i].offsetTop < seeHeight + scrollTop) {
          if (images[i].getAttribute('src') === `https://chiyo.now.sh/favicon.ico`) {
            images[i].src = images[i].getAttribute('data-src');
          }
          n++
        }
      }
    }
  }

  function loadHScene(charaId) {
    return new Promise(resolve => {
      fetch(`http://dugrqaqinbtcq.cloudfront.net/product/event/hscene_r18/${MD5(`hscene_r18_${charaId}`)}.bin?o1`)
      .then(res => res.arrayBuffer())
      .then(buffer => {
        let dec = new TextDecoder('utf-8')
        let story = dec.decode(pako.inflate(buffer))
        resolve(story.replace(/\r\n/g, '\n').split('\n'))
      })
    })
  }
